Below is a brief introduction to Pascal's triangle.
Pascal’s triangle is helpful to describe various combinatorial outcomes using simple arithmetic ratios, including that involved in the probable outcomes of games of chance and some of the advantages of perpetual motion machines. Pascal’s triangle is a triangular arrangement of numbers that gives the coefficients in the expansion of any number (typically a binomial) as a sum of numbers that are placed above it. For example, in the expansion (X + Y)5, the number 5 is obtained by adding the numbers the coefficients of X and Y, found at the first and third rows.
